import * as React from 'react';
import {Link} from "react-router-dom";
import './sidenav.css';
import Folder from '../MenuIcons/FolderSimple.svg';
import Arrow from '../MenuIcons/CaretRight.svg';
import {IoMdArrowBack} from "react-icons/io";
import {useEffect, useState} from "react";

export function SideNav() {
    const [open,setOpen]=useState(true);
    const [dropOpen,setDropOpen]=useState(false);
    const [moviesName,setMoviesName]=useState([]);
    let mNameData = [];

    const [selectedItem, setSelectedItem] = useState(null);

    const handleItemClick = (item) => {
        setSelectedItem(item);
        setDropOpen(true);
    };

    const Dropfn=()=>{
        setDropOpen(!dropOpen);

    }
    useEffect(() => {
        fetchDataFromAPI();

    }, []);


    const fetchDataFromAPI = async () => {
        try {
            const response = await fetch('https://swapi.dev/api/films/');
            const data = await response.json();
            mNameData=data.results.map((name)=>name.title);
            setMoviesName(mNameData);
            doSomethingWithData();

        } catch (error) {
            console.error('Error fetching data: ', error);

        }
    };
    const doSomethingWithData = () => {
        console.log(mNameData);
    };


    const menuElements = [
        {
            icon:Folder,
            title: 'Films',
            path: '/films',
            arrow:Arrow,
        },
        {
            icon:Folder,
            title: 'People',
            path: '/people',
            arrow:Arrow,
        },
        {
            icon:Folder,
            title: 'Planets',
            path: '/planets',
            arrow:Arrow,
        }
        ,
        {
            icon:Folder,
            title: 'Species',
            path: '/species'
            ,
            arrow:Arrow,
        }
        ,
        {
            icon:Folder,
            title: 'Starships',
            path: '/starships',
            arrow:Arrow,

        }
        ,
        {
            icon:Folder,
            title: 'Vehicles',
            path: '/vehicles',
            arrow:Arrow,
        }

    ];

    return (
        <div className={``}>
            <div className={` h-screen  ${open?'w-72':'w-24 -ms-6'} relative duration-300 sideNavbarMain`}>
                <div>
                <IoMdArrowBack className={`md:hidden sm:block bg-white text-black-50 text-2xl rounded-full absolute -right-3 top-5 cursor-pointer ${!open && 'rotate-180'}`} onClick={()=>setOpen(!open)}/>
                </div>
                <ul >
                    {menuElements.map((element, index) => (
                        <>
                            <li key={index} className={`text-white gap-x-4 flex item-center relative cursor-pointer hover:bg-white  duration-300  rounded-md mt-2 sideNavBar-${selectedItem && selectedItem.title === element.title ? 'selected' : 'unselected'} `} onClick={() => handleItemClick(element)}>
                                <span className={`pt-1 `}><img src={element.icon}/></span>
                                <span className={`  text-white font-medium  duration-300 flex-1 ${!open && 'hidden'}`}>{element.title}</span>
                                <span className={`${!open && 'hidden'} absolute  duration-300 right-3 pt-1 ${selectedItem && selectedItem.title === element.title? 'rotate-90' : 'rotate-0'}`} onClick={Dropfn}><img src={element.arrow}/></span>
                            </li>
                            {dropOpen && selectedItem.title === element.title?  (


                                    <ul >
                                        {moviesName.map((movie, index) => (
                                            <>
                                            <li key={index}>

                                                <span className={`pt-1 `}><img src={element.icon}/></span>
                                                <span className={`  text-white font-medium  duration-300 flex-1 `}>{movie}</span>
                                                <span className={`absolute  duration-300 right-3 pt-1 `} ><img src={element.arrow}/></span>
                                            </li>

                                            </>
                                        ))}
                                    </ul>
                              
                            ):
                                <div></div>
                            }



                        </>
                    ))}
                </ul>

                </div>
            {dropOpen && (
                <div className="mt-4 mx-4">
                    <h3 className="text-white font-bold">Movies:</h3>
                    <ul className="text-white">
                        {moviesName.map((movie, index) => (
                            <li key={index}>{movie}</li>
                        ))}
                    </ul>
                </div>
            )}


        </div>
    );
}
